import React, { useEffect, useState } from 'react';
import { Formik, Form, Field } from 'formik';
import axios from 'axios';
import * as Yup from 'yup';
import ServiceMethods from "../../../utils/ServiceMethods";
import menuServices from "../../../services/menuServices/MenuServices";
import OrderServices from "../../../services/orderServices/OrderService";
import "../demo/MenuDish.css"

const MenuDish = () => {
    const [menuDishes, setMenuDishes] = useState([]);
    const [cart, setCart] = useState([]);
    const [pageCount, setPageCount] = useState(0);
    const pagination = { page: 0, size: 10 }; // Adjust as needed

    const getMenu = async () => {
        await ServiceMethods.get(menuServices.getList, pagination, (data) => {
            setMenuDishes(data);
            setPageCount(Math.ceil(data.length / pagination.size));
        });
    };

    useEffect(() => {
        getMenu();
    }, []);

    const addToCart = (dish, quantity) => {
        if (quantity > 0) {
            setCart((prevCart) => {
                const existingDish = prevCart.find(item => item.id === dish.id);
                if (existingDish) {
                    return prevCart.map(item =>
                        item.id === dish.id
                            ? { ...item, quantity: item.quantity + quantity }
                            : item
                    );
                } else {
                    return [...prevCart, { ...dish, quantity }];
                }
            });
        }
    };

    const submitOrder = async (values) => {
        try {
            const detailList = cart.map(dish => ({
                menuId: dish.id,
                quantity: dish.quantity,
            }));

            const orderRequest = {
                description: values.description,
                promotionCode: values.promotionCode,
                status: "WAITING",
                detailList,
            };

            const response = await OrderServices.createOrder(orderRequest);
            console.log("Order submitted successfully:", response.data);
            setCart([]); // Clear the cart after submission
        } catch (error) {
            console.error("Error creating order", error);
        }
    };

    return (
        <div className="DemoMenuDish">
            <h1>Menu Dishes</h1>
            <ul>
                {menuDishes.map((dish) => (
                    <li key={dish.id}>
                        <h2>{dish.name}</h2>
                        <input
                            type="number"
                            min="1"
                            defaultValue="1"
                            id={`quantity-${dish.id}`}
                        />
                        <button onClick={() => {
                            const quantity = parseInt(document.getElementById(`quantity-${dish.id}`).value, 10);
                            addToCart(dish, quantity);
                        }}>
                            Add to Cart
                        </button>
                    </li>
                ))}
            </ul>

            <h2>Cart</h2>
            <ul>
                {cart.map((dish, index) => (
                    <li key={index}>
                        {dish.name} (Quantity: {dish.quantity})
                    </li>
                ))}
            </ul>

            <h2>Order Details</h2>
            <Formik
                initialValues={{ description: '', promotionCode: '' }}
                validationSchema={Yup.object({
                    description: Yup.string().required('Required'),
                    promotionCode: Yup.string(),
                })}
                onSubmit={submitOrder}
            >
                {({ touched, errors }) => (
                    <Form>
                        <div>
                            <label>
                                Description:
                                <Field name="description" type="text" />
                            </label>
                            {touched.description && errors.description ? (
                                <div>{errors.description}</div>
                            ) : null}
                        </div>
                        <div>
                            <label>
                                Promotion Code:
                                <Field name="promotionCode" type="text" />
                            </label>
                        </div>
                        <button type="submit" disabled={cart.length === 0}>
                            Submit Order
                        </button>
                    </Form>
                )}
            </Formik>
        </div>
    );
};

export default MenuDish;
